import React, { useState, useEffect } from "react";
import "./TimeWithAnimals.css";

const TimeWithAnimals = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    activity: "",
    date: "",
    time: "",
    message: "",
  });

  const [submitted, setSubmitted] = useState(false);

  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Wysano:", formData);
    setSubmitted(true);
    setFormData({
      name: "",
      email: "",
      phone: "",
      activity: "",
      date: "",
      time: "",
      message: "",
    });
  };

  return (
    <div className="time-with-animals-page">
      <header
        className="activity-header"
        style={{ backgroundImage: "url('/img/time-with-dog.jpg')" }}
      >
        <h1 className="activity-title">Spd藕 czas ze zwierzakiem</h1>
      </header>

      <div className="activity-wrapper activity-wrapper-overlap">
        <p className="activity-intro">
          Nie musisz by wolontariuszem, aby pom贸c naszym podopiecznym. 
          Mo偶esz um贸wi si na spacer, zabaw z kotem, sprztanie boks贸w 
          lub po prostu przyj na chwil towarzystwa.
        </p>

        <div className="activity-contact">
          <a href="tel:+48123123123" className="activity-phone">
            Zadzwo: 123-123-123
          </a>

          <div className="activity-form">
            <h2>Um贸w wizyt</h2>

            {submitted ? (
              <div className="form-success">
                <p>Dzikujemy! Twoje zgoszenie zostao wysane </p>
              </div>
            ) : (
              <form onSubmit={handleSubmit}>
                <input
                  type="text"
                  name="name"
                  placeholder="Imi i nazwisko"
                  value={formData.name}
                  onChange={handleChange}
                  required
                />
                <input
                  type="email"
                  name="email"
                  placeholder="Email"
                  value={formData.email}
                  onChange={handleChange}
                  required
                />
                <input
                  type="tel"
                  name="phone"
                  placeholder="Telefon (opcjonalnie)"
                  value={formData.phone}
                  onChange={handleChange}
                />

                <select
                  name="activity"
                  value={formData.activity}
                  onChange={handleChange}
                  required
                >
                  <option value="">Wybierz aktywno</option>
                  <option value="spacer">Spacer z psem</option>
                  <option value="zabawa">Zabawa z kotem</option>
                  <option value="sprzatanie">Sprztanie boks贸w</option>
                  <option value="inne">Inne</option>
                </select>

                <input
                  type="date"
                  name="date"
                  value={formData.date}
                  onChange={handleChange}
                  required
                />

                <input
                  type="time"
                  name="time"
                  min="10:00"
                  max="18:00"
                  value={formData.time}
                  onChange={handleChange}
                  required
                />

                <textarea
                  name="message"
                  placeholder="Uwagi / wiadomo"
                  value={formData.message}
                  onChange={handleChange}
                ></textarea>

                <button type="submit">Wylij zgoszenie</button>
              </form>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default TimeWithAnimals;
